IF OBJECT_ID('dbo.sales_data', 'U') IS NOT NULL
    DROP TABLE dbo.sales_data;
GO

CREATE TABLE dbo.sales_data (
    OrderID INT NOT NULL,
    OrderNumber VARCHAR(50) NOT NULL,
    OrderDate DATE NOT NULL,
    CustomerID VARCHAR(50) NOT NULL,
    Segment VARCHAR(50),
    City VARCHAR(50),
    ProductName VARCHAR(100),
    [Category] VARCHAR(50),
    SubCategory VARCHAR(50),
    Sales DECIMAL(10,2),
    Quantity INT,
    Discount DECIMAL(5,2),
    Profit DECIMAL(10,2)
);
GO



select * from sales_data

SELECT COUNT(*) AS total_rows FROM dbo.sales_data;

SELECT
  SUM(CASE WHEN OrderDate IS NULL THEN 1 ELSE 0 END) AS missing_orderdate,
  SUM(CASE WHEN CustomerID IS NULL OR CustomerID = '' THEN 1 ELSE 0 END) AS missing_customerid,
  SUM(CASE WHEN ProductName IS NULL OR ProductName = '' THEN 1 ELSE 0 END) AS missing_product
FROM dbo.sales_data;

SELECT MIN(OrderDate) AS min_date, MAX(OrderDate) AS max_date FROM dbo.sales_data;

SELECT OrderID, COUNT(*) AS cnt
FROM dbo.sales_data
GROUP BY OrderID
HAVING COUNT(*) > 1;

SELECT
  COUNT(DISTINCT CustomerID) AS customers,
  SUM(Sales) AS total_sales,
  SUM(Profit) AS total_profit,
  AVG(Sales) AS avg_sale
FROM dbo.sales_data;

CREATE NONCLUSTERED INDEX idx_sales_orderdate ON dbo.sales_data(OrderDate);
CREATE NONCLUSTERED INDEX idx_sales_customer ON dbo.sales_data(CustomerID);
CREATE NONCLUSTERED INDEX idx_sales_city ON dbo.sales_data(City);
CREATE NONCLUSTERED INDEX idx_sales_category ON dbo.sales_data([Category]);

SELECT
  SUM(Sales) AS total_sales,
  SUM(Profit) AS total_profit,
  SUM(Quantity) AS total_quantity
FROM dbo.sales_data;

SELECT YEAR(OrderDate) AS yr,
  SUM(Sales) AS sales,
  SUM(Profit) AS profit,
  SUM(Quantity) AS quantity
FROM dbo.sales_data
GROUP BY YEAR(OrderDate)
ORDER BY yr;

SELECT
  CONVERT(VARCHAR(7), OrderDate, 120) AS year_month, -- YYYY-MM
  SUM(Sales) AS monthly_sales,
  SUM(Profit) AS monthly_profit
FROM dbo.sales_data
GROUP BY CONVERT(VARCHAR(7), OrderDate, 120)
ORDER BY year_month;

SELECT TOP 10 ProductName, Category, SubCategory,
  SUM(Sales) AS total_sales,
  SUM(Quantity) AS total_qty
FROM dbo.sales_data
GROUP BY ProductName, Category, SubCategory
ORDER BY total_sales DESC;

SELECT TOP 15 City,
  SUM(Sales) AS sales,
  SUM(Profit) AS profit,
  CASE WHEN SUM(Sales) = 0 THEN 0 ELSE ROUND(SUM(Profit)/SUM(Sales)*100,2) END AS profit_margin_pct
FROM dbo.sales_data
GROUP BY City
ORDER BY sales DESC;

-- 1) find snapshot date
DECLARE @snapshot DATE = (SELECT MAX(OrderDate) FROM dbo.sales_data);

-- 2) RFM per customer
SELECT
  CustomerID,
  DATEDIFF(DAY, MAX(OrderDate), @snapshot) AS RecencyDays,
  COUNT(*) AS Frequency,
  SUM(Sales) AS Monetary
FROM dbo.sales_data
GROUP BY CustomerID
ORDER BY Monetary DESC;

SELECT ProductName, Category, SubCategory,
  SUM(Sales) AS sales,
  SUM(Profit) AS profit
FROM dbo.sales_data
GROUP BY ProductName, Category, SubCategory
HAVING SUM(Profit) < 0
ORDER BY profit ASC;

SELECT * FROM dbo.sales_data;

SELECT
    CONVERT(VARCHAR(7), OrderDate, 120) AS YearMonth,
    SUM(Sales) AS TotalSales,
    SUM(Profit) AS TotalProfit,
    SUM(Quantity) AS TotalQuantity
FROM dbo.sales_data
GROUP BY CONVERT(VARCHAR(7), OrderDate, 120)
ORDER BY YearMonth;

SELECT TOP 15
    ProductName,
    Category,
    SubCategory,
    SUM(Sales) AS TotalSales,
    SUM(Quantity) AS TotalQuantity,
    SUM(Profit) AS TotalProfit
FROM dbo.sales_data
GROUP BY ProductName, Category, SubCategory
ORDER BY TotalSales DESC;

SELECT
    City,
    SUM(Sales) AS TotalSales,
    SUM(Profit) AS TotalProfit,
    SUM(Quantity) AS TotalQuantity,
    CASE
        WHEN SUM(Sales) = 0 THEN 0
        ELSE ROUND((SUM(Profit) / SUM(Sales)) * 100, 2)
    END AS ProfitMarginPercent
FROM dbo.sales_data
GROUP BY City
ORDER BY TotalSales DESC;

SELECT
    COUNT(*) AS TotalOrders,
    COUNT(DISTINCT CustomerID) AS TotalCustomers,
    SUM(Sales) AS TotalSales,
    SUM(Profit) AS TotalProfit,
    AVG(Sales) AS AvgOrderValue,
    SUM(Quantity) AS TotalQuantity
FROM dbo.sales_data;


















